import React from 'react';
import ChatBot from './components/ChatBot';

function App() {
  return (
    <div className="min-h-screen bg-gray-100">
      <main className="container mx-auto px-4 py-8">
        <h1 className="text-4xl font-bold text-gray-900 mb-8">Travel Website</h1>
        <p className="text-lg text-gray-700 mb-4">
          Welcome to our travel platform. How can we help you plan your next adventure?
        </p>
      </main>
      <ChatBot />
    </div>
  );
}

export default App;
